"132":{"department":"PE","number":"132","title":"Swimming: Advanced","description":"This class is for those who can swim 100 yards freestyle continuously and have had an introduction to backstroke and breaststroke.  In this class you will learn: refinement of the 4 competitive swimming strokes: freestyle, breaststroke, backstroke, butterfly (review/intro) and efficient breathing techniques.  You will gain additional development of flipturns using intervals (100 yard repeats), competitive starts and turns, use of swimming equipment (kick boards, pull buoys, hand paddles, fins) for fitness, and videotaping with review.  nPrereq:  Swim 100 yards continuous of freestyle. If you have not had an introduction to Breaststroke or backstroke, we recommend you take ATH 131 Swimming Intermediate.nGoals:  Refinement of all 4 competitive strokes, execution of 100 yard interval sets with flipturns (Freestyle, Individual Medley).  Build strong foundation for reaching your swimming fitness goals (i.e. lap swimming, triathlons, masters swimming, open water swimming.)  Evolve to swim 1,000 &iquest; 1,500 yards per class.  Fee. (AU).","min_units":1,"max_units":1,"gers":[],"id":102574,"primary":[[{"primary-instructors":[],"secondary-instructors":["Lonaker, S."],"meeting-times":[{"days":[true,false,true,false,false],"start":"3:00:00 PM","end":"3:50:00 PM","instructors":["Lonaker, S."],"location":"Avery Recreational Pool"}],"id":18936},{"primary-instructors":[],"secondary-instructors":["Lonaker, S."],"meeting-times":[{"days":[false,true,false,true,false],"start":"3:00:00 PM","end":"3:50:00 PM","instructors":["Lonaker, S."],"location":"Avery Recreational Pool"}],"id":27731}],[{"primary-instructors":[],"secondary-instructors":["Lonaker, S."],"meeting-times":[{"days":[true,false,true,false,false],"start":"1:00:00 PM","end":"1:50:00 PM","instructors":["Lonaker, S."],"location":"Avery Recreational Pool"}],"id":19121},{"primary-instructors":[],"secondary-instructors":["Lonaker, S."],"meeting-times":[{"days":[false,true,false,true,false],"start":"10:00:00 AM","end":"10:50:00 AM","instructors":["Lonaker, S."],"location":"Avery Recreational Pool"}],"id":19122}],[{"primary-instructors":[],"secondary-instructors":["Lonaker, S."],"meeting-times":[{"days":[false,true,false,true,false],"start":"3:00:00 PM","end":"3:50:00 PM","instructors":["Lonaker, S."],"location":"Avery Recreational Pool"}],"id":19502}]],"primary_type":"Activity"},
"133":{"department":"PE","number":"133","title":"Swim Conditioning","description":"Improve cardio-respiratory endurance through directed swimming workouts. Technique corrections as needed. Prerequisite: advanced swimmer. Fee. (AU)","min_units":1,"max_units":1,"gers":[],"id":102578,"primary":[[{"primary-instructors":[],"secondary-instructors":["Lowe, S."],"meeting-times":[{"days":[false,true,false,true,false],"start":"11:00:00 AM","end":"11:50:00 AM","instructors":["Lowe, S."],"location":"Avery Aquatic Center"}],"id":18502}],[{"primary-instructors":[],"secondary-instructors":["Bokker, A."],"meeting-times":[{"days":[false,true,false,true,false],"start":"11:00:00 AM","end":"11:50:00 AM","instructors":["Bokker, A."],"location":"Avery Aquatic Center"}],"id":9563}],[{"primary-instructors":[],"secondary-instructors":["Armstrong, S."],"meeting-times":[{"days":[true,false,true,false,false],"start":"11:00:00 AM","end":"11:50:00 AM","instructors":["Armstrong, S."],"location":"Avery Aquatic Center"}],"id":17140},{"primary-instructors":[],"secondary-instructors":["Knapp, T."],"meeting-times":[{"days":[false,true,false,true,false],"start":"11:00:00 AM","end":"11:50:00 AM","instructors":["Knapp, T."],"location":"Avery Aquatic Center"}],"id":10016}]],"primary_type":"Activity"},
"134":{"department":"PE","number":"134","title":"Synchronized Swimming, Beginning","description":"Students will learn basic skills and techniques associated with synchronized swimming. Students will learn how synchronized swimming is judged alongside some of the basic moves. Sculling with the arms and an 'egg beater' motion with the legs keeps the swimmer stable and allows the more advanced techniques to be performed. This course will utilize class discussions, class assignments and student participation to enable students to: (1) Understand basic components of health-related physical fitness, cardiovascular fitness, muscle endurance and flexibility (2) Develop physical fitness and motor skills, and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle. Prerequisite: intermediate to advanced swimming skills. Fee. (AU)","min_units":1,"max_units":1,"gers":[],"id":207295,"primary":[[{"primary-instructors":[],"secondary-instructors":["Azebu, M."],"meeting-times":[{"days":[false,true,false,true,false],"start":"10:00:00 AM","end":"10:50:00 AM","instructors":["Azebu, M."],"location":"Avery Aquatic Center"}],"id":30072}],[],[]],"primary_type":"Activity"},
"135":{"department":"PE","number":"135","title":"Aqua Boot Camp","description":"A unique combination of swim conditioning, swim power training and dry land training offered by the staff of the Women's Swimming program. &nbsp;Increase your strength and cardiovascular endurance, in and out of the water.&nbsp; Prerequisites: Ability to tread deep water for 5 minutes and swim at least 50 meters continuously of backstroke, front crawl, & breaststroke. &nbsp;This is not a learn-to-swim class. Fee.","min_units":1,"max_units":1,"gers":[],"id":214125,"primary":[[],[],[{"primary-instructors":[],"secondary-instructors":["Duchac, T."],"meeting-times":[{"days":[true,false,true,false,false],"start":"10:00:00 AM","end":"10:50:00 AM","instructors":["Duchac, T.","Meehan, G."],"location":"Avery Aquatic Center"}],"id":18500}]],"primary_type":"Activity"},
"136":{"department":"PE","number":"136","title":"Swimming: Stroke Refinement","description":"Review and fine tune the 4 competitive strokes (freestyle, backstroke, butterfly, and breaststroke), with a primary emphasis on improving freestyle stroke efficiency.  Flipturn refinement.  Drill and technique work will be heavily emphasized.  On average, 1000 meters will be swum per class.  nPrereq:  Ability to tread deep water for 5 minutes, swim 100 meter intervals of freestyle, backstroke, and breaststroke with rhythmic breathing, and swim 200 meters continuously under 5 minutes.","min_units":1,"max_units":1,"gers":[],"id":214879,"primary":[[{"primary-instructors":[],"secondary-instructors":["Tanner, J."],"meeting-times":[{"days":[true,false,true,false,false],"start":"10:00:00 AM","end":"10:50:00 AM","instructors":["Tanner, J."],"location":"Avery Aquatic Center"}],"id":27740}],[],[]],"primary_type":"Activity"},
"138":{"department":"PE","number":"138","title":"Table Tennis: Intermediate","description":"This class is intended for players who have experience playing table-tennis including those who have taken the beginning table-tennis class. Students should have prior experience in countering, looping, chopping, and serving.","min_units":1,"max_units":1,"gers":[],"id":211831,"primary":[[{"primary-instructors":[],"secondary-instructors":["Shodhan, S."],"meeting-times":[{"days":[false,true,false,true,false],"start":"11:00:00 AM","end":"11:50:00 AM","instructors":["Shodhan, S."],"location":"Ford Center"}],"id":27651}],[{"primary-instructors":[],"secondary-instructors":["Shodhan, S."],"meeting-times":[{"days":[false,true,false,true,false],"start":"11:00:00 AM","end":"11:50:00 AM","instructors":["Shodhan, S."],"location":"Ford Center"}],"id":18768}],[{"primary-instructors":[],"secondary-instructors":["Shodhan, S."],"meeting-times":[{"days":[false,true,false,true,false],"start":"11:00:00 AM","end":"11:50:00 AM","instructors":["Shodhan, S."],"location":"Ford Center"}],"id":17154}]],"primary_type":"Activity"},
