"14":{"department":"PE","number":"14","title":"Basketball Skills","description":"Although this course is designed for players of intermediate to advance skill level, it is open to anyone hoping to improve as a player.  Focus will be placed on individual skills such as passing, dribbling, shooting, rebounding, defending, and post play.  Team offensive and defensive principles will be taught through intra-class competition.","min_units":1,"max_units":1,"gers":[],"id":212777,"primary":[[{"primary-instructors":[],"secondary-instructors":["Thornton, M."],"meeting-times":[{"days":[false,true,false,true,false],"start":"10:00:00 AM","end":"10:50:00 AM","instructors":["Thornton, M."],"location":"ArrilagaOutdoorEducRecCtrBsktb"}],"id":26484}],[{"primary-instructors":[],"secondary-instructors":["Thornton, M."],"meeting-times":[{"days":[false,true,false,true,false],"start":"10:00:00 AM","end":"10:50:00 AM","instructors":["Thornton, M."],"location":"ArrilagaOutdoorEducRecCtrBsktb"}],"id":31639}],[{"primary-instructors":[],"secondary-instructors":["Thornton, M."],"meeting-times":[{"days":[false,true,false,true,false],"start":"10:00:00 AM","end":"10:50:00 AM","instructors":["Thornton, M."],"location":"ArrilagaOutdoorEducRecCtrBsktb"}],"id":31983}]],"primary_type":"Activity"},
"140":{"department":"PE","number":"140","title":"Taiji Quan (Tai Chi)","description":"Taiji Quan (Tai Chi) is a Chinese martial arts system of slow meditative physical exercise designed for relaxation, balance and health. This course will utilize class discussions, class assignments and student participation to enable students to: (1) Understand basic components of health-related physical fitness (2) Develop physical fitness and motor skills, and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle. All levels are welcome.","min_units":1,"max_units":1,"gers":[],"id":211464,"primary":[[{"primary-instructors":[],"secondary-instructors":["Zhang, H."],"meeting-times":[{"days":[false,true,false,true,false],"start":"10:00:00 AM","end":"10:50:00 AM","instructors":["Zhang, H."],"location":"Burnham Pavilion"}],"id":25602}],[{"primary-instructors":[],"secondary-instructors":["Zhang, H."],"meeting-times":[{"days":[true,false,true,false,false],"start":"10:00:00 AM","end":"10:50:00 AM","instructors":["Zhang, H."],"location":"Burnham Pavilion"}],"id":16814}],[{"primary-instructors":[],"secondary-instructors":["Zhang, H."],"meeting-times":[{"days":[false,true,false,true,false],"start":"10:00:00 AM","end":"10:50:00 AM","instructors":["Zhang, H."],"location":""}],"id":17062}]],"primary_type":"Activity"},
"141":{"department":"PE","number":"141","title":"Tai Chi: Intermediate","description":"At the Intermediate level, students will develop a deeper and more internal understanding of Tai Chi. This course will introduce new concepts and movements that are more challenging. This course will also utilize class discussions, class assignments and student participation to enable students to: (1) Understand basic components of health-related physical fitness (2) Develop physical fitness and motor skills, and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle.n nPrerequisite: ATHLETIC 140 or prior practice and courses in Tai Chi.","min_units":1,"max_units":1,"gers":[],"id":215730,"primary":[[],[{"primary-instructors":[],"secondary-instructors":["Zhang, H."],"meeting-times":[{"days":[true,false,true,false,false],"start":"11:00:00 AM","end":"11:50:00 AM","instructors":["Zhang, H."],"location":"Burnham Pavilion"}],"id":29673}],[]],"primary_type":"Activity"},
