"16":{"department":"PE","number":"16","title":"Bellydance Fusion","description":"This course will introduce students to the fundamentals of belly dance with a focus on fusion and tribal fusion styles. &nbsp;No dance experience is required for this class; however, it is also suitable for students with previous belly dance training. &nbsp;Over the course of the quarter students will build their technique and learn a full choreography.","min_units":1,"max_units":1,"gers":[],"id":214213,"primary":[[{"primary-instructors":[],"secondary-instructors":["Kitch, L."],"meeting-times":[{"days":[false,true,false,true,false],"start":"6:00:00 PM","end":"6:50:00 PM","instructors":["Kitch, L."],"location":"ArrilagaOutdoorEducRecCtrUpStu"}],"id":29795}],[],[]],"primary_type":"Activity"},
"161":{"department":"PE","number":"161","title":"Volleyball: Beginning Sand","description":"This course is designed to help students gain proficient skills and knowledge of the game of sand volleyball. This is an introductory course for those with limited or no playing experience. Instruction will include techniques for passing, setting, serving, serve receive, hitting, blocking, digging, and transition. The course is arranged to familiarize students with the rules, terminology, offensive and defensive strategies, team organization, communication, game play, and conditioning for volleyball. This course will utilize class discussions, class assignments and student participation to enable students to: (1) Understand basic components of health-related physical fitness (2) Develop physical fitness and motor skills, and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle.","min_units":1,"max_units":1,"gers":[],"id":216531,"primary":[[],[],[{"primary-instructors":[],"secondary-instructors":["Shaw, D."],"meeting-times":[{"days":[true,false,true,false,false],"start":"11:30:00 AM","end":"12:20:00 PM","instructors":["Shaw, D."],"location":""}],"id":33033}]],"primary_type":"Activity"},
"162":{"department":"PE","number":"162","title":"Volleyball","description":"This course is designed to help students gain proficient skills and knowledge of the game of volleyball. This is an introductory course for those with limited or no playing experience. Instruction will include techniques for passing, setting, serving, serve receive, hitting, blocking, digging, and transition. The course is arranged to familiarize students with the rules, terminology, offensive and defensive strategies, team organization, communication, game play, and conditioning for volleyball. This course will utilize class discussions, class assignments and student participation to enable students to: (1) Understand basic components of health-related physical fitness (2) Develop physical fitness and motor skills, and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle.","min_units":1,"max_units":1,"gers":[],"id":102713,"primary":[[{"primary-instructors":[],"secondary-instructors":["Price, A."],"meeting-times":[{"days":[false,true,false,false,false],"start":"8:00:00 PM","end":"9:50:00 PM","instructors":["Price, A."],"location":""}],"id":25594}],[{"primary-instructors":[],"secondary-instructors":["Price, A."],"meeting-times":[{"days":[false,true,false,false,false],"start":"7:00:00 PM","end":"8:50:00 PM","instructors":["Price, A."],"location":"Maples Pavilion"}],"id":19190}],[]],"primary_type":"Activity"},
"163":{"department":"PE","number":"163","title":"Volleyball: Intermediate/Advanced","description":"This course is designed for players of intermediate to advanced skill level. This course will review the basic fundamentals of volleyball, proper conditioning for volleyball, and various tournament situations. Students will learn advanced concepts in team strategy through offense and defense with varying defensive and offensive systems. This course will utilize class discussions, class assignments and student participation to enable students to: (1) Understand basic components of health-related physical fitness (2) Develop physical fitness and motor skills, and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle.","min_units":1,"max_units":1,"gers":[],"id":216001,"primary":[[],[{"primary-instructors":[],"secondary-instructors":["Price, A."],"meeting-times":[{"days":[false,false,false,true,false],"start":"7:00:00 PM","end":"8:50:00 PM","instructors":["Price, A."],"location":"Maples Pavilion"}],"id":30235}],[]],"primary_type":"Activity"},
