"185":{"department":"PE","number":"185","title":"Yoga: Intermediate Asana","description":"This course is designed for students who already possess an ongoing yoga practice. This course will move deeper into all aspects of yoga by exploring more postures, pranayama and meditation techniques. This course is designed for students who wish to improve themselves both physically and mentally. Intermediate yoga will provide students with information and experience which will enable students to: (1) Acquire knowledge of the basic components of health and wellness. (2) Develop physical fitness and motor skills, and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle.","min_units":1,"max_units":1,"gers":[],"id":215579,"primary":[[{"primary-instructors":[],"secondary-instructors":["Agostino, K."],"meeting-times":[{"days":[false,true,false,true,false],"start":"9:00:00 AM","end":"9:50:00 AM","instructors":["Agostino, K."],"location":"ACSR Studio"}],"id":29113}],[{"primary-instructors":[],"secondary-instructors":["Selig, H."],"meeting-times":[{"days":[false,true,false,true,false],"start":"9:00:00 AM","end":"9:50:00 AM","instructors":["Selig, H."],"location":"ACSR Studio"}],"id":20431}],[{"primary-instructors":[],"secondary-instructors":["Mitchell, Y."],"meeting-times":[{"days":[false,true,false,true,false],"start":"9:00:00 AM","end":"9:50:00 AM","instructors":["Mitchell, Y."],"location":"ACSR Studio"}],"id":20662}]],"primary_type":"Activity"},
