"2":{"department":"PE","number":"2","title":"Abs and Glutes","description":"Abs and Gluteus is a group workout that utilizes your own body weight and a variety of small equipment for resistance to help you build stronger, leaner muscles in your midsection and gluteus. This course will utilize class discussions, class assignments and student participation to enable students to: (1) Understand basic components of health-related physical fitness such as: muscular strength and endurance and flexibility (2) Develop physical fitness and motor skills, and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle. Fee. (AU)","min_units":1,"max_units":1,"gers":[],"id":206955,"primary":[[{"primary-instructors":[],"secondary-instructors":["Conniff, N."],"meeting-times":[{"days":[true,false,true,false,false],"start":"11:00:00 AM","end":"11:50:00 AM","instructors":["Conniff, N."],"location":"ACSR Basketball Courts"}],"id":26666}],[{"primary-instructors":[],"secondary-instructors":["Tapia, B."],"meeting-times":[{"days":[false,true,false,true,false],"start":"11:00:00 AM","end":"11:50:00 AM","instructors":["Tapia, B."],"location":"ACSR Basketball Courts"}],"id":17731}],[{"primary-instructors":[],"secondary-instructors":["Tapia, B."],"meeting-times":[{"days":[false,true,false,true,false],"start":"11:00:00 AM","end":"11:50:00 AM","instructors":["Tapia, B."],"location":"ACSR Basketball Courts"}],"id":18011}]],"primary_type":"Activity"},
"20":{"department":"PE","number":"20","title":"Barre Fusion","description":"This course is a mix of Barre exercises, Pilates exercises, Yoga poses and stretching specifically designed to increase strength and muscle tone in the entire  body and overall flexibility.  We focus on proper alignment and improving posture.  The exercises are intense and effective yet extremely accessible. This course will also utilize class instruction, assignments and student participation to enable students to: (1) Acquire knowledge of the basic components of health and wellness. (2) Develop physical fitness and motor skills, and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle.","min_units":1,"max_units":1,"gers":[],"id":216421,"primary":[[],[{"primary-instructors":[],"secondary-instructors":["Agostino, K."],"meeting-times":[{"days":[true,false,true,false,false],"start":"9:00:00 AM","end":"9:50:00 AM","instructors":["Agostino, K."],"location":"ArrilagaOutdoorEducRecCtrUpStu"}],"id":32476}],[{"primary-instructors":[],"secondary-instructors":["Agostino, K."],"meeting-times":[{"days":[true,false,true,false,false],"start":"9:00:00 AM","end":"9:50:00 AM","instructors":["Agostino, K."],"location":"ArrilagaOutdoorEducRecCtrUpStu"}],"id":32923}]],"primary_type":"Activity"},
