"32":{"department":"PE","number":"32","title":"Boot Camp","description":"This course will focus on understanding the basic components of health-related physical fitness (cardiovascular fitness, muscular strength and endurance, and flexibility).  Students will have the opportunity to engage in a variety of physical activities, which will enhance all aspects of health-related fitness.  This course will utilize class discussions, class assignments and student participation to enable students to: (1) Understand basic components of health-related physical fitness (2) Develop physical fitness skills and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle. May be repeated for credit","min_units":1,"max_units":1,"gers":[],"id":215956,"primary":[[],[{"primary-instructors":[],"secondary-instructors":["Breen, L."],"meeting-times":[{"days":[true,false,true,false,false],"start":"2:15:00 PM","end":"3:05:00 PM","instructors":["Breen, L."],"location":"ACSR Studio"}],"id":30132}],[{"primary-instructors":[],"secondary-instructors":["Breen, L."],"meeting-times":[{"days":[true,false,true,false,false],"start":"4:30:00 PM","end":"5:20:00 PM","instructors":["Breen, L."],"location":"ACSR Basketball Courts"}],"id":30575}]],"primary_type":"Activity"},
