"39":{"department":"PE","number":"39","title":"Fencing: Beginning","description":"The sport of swordmanship develops quick hands, strong legs, and a strategic mind. Footwork, handwork, and bouting. Emphasis is on foil technique. All equipment provided. Fee. (AU)","min_units":1,"max_units":1,"gers":[],"id":102358,"primary":[[{"primary-instructors":[],"secondary-instructors":["Posthumus, L."],"meeting-times":[{"days":[true,false,true,false,false],"start":"1:15:00 PM","end":"2:05:00 PM","instructors":["Lepeshinski, A.","Posthumus, L."],"location":""}],"id":18464}],[],[]],"primary_type":"Activity"},
