"43":{"department":"PE","number":"43","title":"Futsal","description":"Futsal is a variant of soccer that is played on a smaller playing surface and mainly played indoors.  Soccer greats such as Kaka, Ronaldo, Ronaldinho, Marta and Messi grew up playing Futsal and credit it for developing their incredible skills. Learn quick reflexes, fast thinking and pin-point passing. With five-a-side play and a special low bounce ball, Futsal will improve your game through its intense pace and rapid execution.","min_units":1,"max_units":1,"gers":[],"id":211909,"primary":[[],[{"primary-instructors":[],"secondary-instructors":["Cota, P."],"meeting-times":[{"days":[true,false,true,false,false],"start":"9:30:00 AM","end":"10:30:00 AM","instructors":["Danielson, S.","Cota, P."],"location":"Ford Center"}],"id":17481}],[]],"primary_type":"Activity"},
