"87":{"department":"PE","number":"87","title":"Learn to Row for Men","description":"This class is an introduction to the sport of rowing for men.  The fundamentals of proper form, technique and workouts to develop cardiovascular fitness will be taught.  The class will progress from rowing ergometer machines into rowing shells on the water. The utilization of class discussions, assignments and student participation will enable students to: (1) Understand basic components of health-related physical fitness, cardiovascular fitness, muscle endurance and flexibility (2) Develop physical fitness and motor skills, and (3) Develop a positive attitude toward wellness and physical activity which will facilitate a healthy lifestyle.","min_units":1,"max_units":1,"gers":[],"id":212718,"primary":[[{"primary-instructors":[],"secondary-instructors":["Hilton, J."],"meeting-times":[{"days":[true,false,true,false,true],"start":"3:15:00 PM","end":"5:15:00 PM","instructors":["Hilton, J."],"location":"Ford Center"}],"id":27951}],[],[]],"primary_type":"Activity"},
